import pytest
from candidates import ListCandidate
from candidates import Candidate


class TestsGetList:
    def test_candidate_status_code_get_list(self):
        assert ListCandidate().get().status_code == 200
    def test_candidate_content_get_list(self):
        assert ListCandidate().get().json()
        
class TestsGetCandidate:
    def test_candidate_status_code_post_get(self):
        new = Candidate().post('Marian Shun', 'QA Intern')
        assert new.status_code == 201 #preconditions
        id = new.json()['candidate']['id']
        assert Candidate().get(id).status_code == 200
    def test_candidate_content_get(self):
        assert Candidate().get(id).json()
    def test_candidate_status_code_get_negative_id(self):
        assert Candidate().get(str(id)+'a').status_code == 404
        
